--
-- Name: _pg_char_max_length(oid, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION _pg_char_max_length(typid oid, typmod integer) RETURNS integer
    LANGUAGE sql IMMUTABLE STRICT
    AS $_$SELECT
  CASE WHEN $2 = -1 /* default typmod */
       THEN null
       WHEN $1 IN (1042, 1043) /* char, varchar */
       THEN $2 - 4
       WHEN $1 IN (1560, 1562) /* bit, varbit */
       THEN $2
       ELSE null
  END$_$;


ALTER FUNCTION public._pg_char_max_length(typid oid, typmod integer) OWNER TO postgres;

--
-- Name: _pg_datetime_precision(oid, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION _pg_datetime_precision(typid oid, typmod integer) RETURNS integer
    LANGUAGE sql IMMUTABLE STRICT
    AS $_$SELECT
  CASE WHEN $1 IN (1082) /* date */
           THEN 0
       WHEN $1 IN (1083, 1114, 1184, 1266) /* time, timestamp, same + tz */
           THEN CASE WHEN $2 < 0 THEN 6 ELSE $2 END
       WHEN $1 IN (1186) /* interval */
           THEN CASE WHEN $2 < 0 THEN 6 ELSE $2 & 65535 END
       ELSE null
  END$_$;


