--
-- Name: _pg_numeric_precision(oid, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION _pg_numeric_precision(typid oid, typmod integer) RETURNS integer
    LANGUAGE sql IMMUTABLE STRICT
    AS $_$SELECT
  CASE $1
         WHEN 21 /*int2*/ THEN 16
         WHEN 23 /*int4*/ THEN 32
         WHEN 20 /*int8*/ THEN 64
         WHEN 1700 /*numeric*/ THEN
              CASE WHEN $2 = -1
                   THEN null
                   ELSE (($2 - 4) >> 16) & 65535
                   END
         WHEN 700 /*float4*/ THEN 24 /*FLT_MANT_DIG*/
         WHEN 701 /*float8*/ THEN 53 /*DBL_MANT_DIG*/
         ELSE null
  END$_$;


ALTER FUNCTION public._pg_numeric_precision(typid oid, typmod integer) OWNER TO postgres;

