CREATE FUNCTION f_get_agent_parent_path(sagent_id character varying, OUT sresult character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
BEGIN
  SELECT ter3.territory_name || ' -> ' || ter2.territory_name
  INTO sresult FROM t_mtr_agent agn
  JOIN t_mtr_territory ter ON agn.territory_id = ter.territory_id
  JOIN t_mtr_territory ter2 ON ter.parent_id = ter2.territory_id
  JOIN t_mtr_territory ter3 ON ter2.parent_id = ter3.territory_id
  WHERE agn.agent_id = sagent_id;
END;
$$;


