WHEN 'ds5' THEN 'yellow'
WHEN 'ds6' THEN 'red'
WHEN 'ds7' THEN 'yellow'
WHEN 'ds8' THEN 'green'
WHEN 'ds9' THEN 'yellow'
WHEN 'ds10' THEN 'red'
