CREATE FUNCTION f_get_sales_name(character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$DECLARE
icount smallint;
s1 VARCHAR;

BEGIN

SELECT count(user_name) INTO icount
FROM t_mtr_user
WHERE user_id = $1
LIMIT 1;

IF icount = 0 THEN
s1 = 'Nama tidak ditemukan';
ELSE
SELECT user_name INTO s1
FROM t_mtr_user
WHERE user_id = $1
LIMIT 1;
END IF;
--nanti kalau sudah v.9.1 ganti concat
	RETURN icount || '#' || s1;

END
$_$;


