--
-- Name: sp_kpi_filtering(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION sp_kpi_filtering() RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
DECLARE
icount INTEGER;

BEGIN

SELECT DISTINCT kpi_code, '' FROM t_temp_mtr_kpi 
WHERE kpi_code NOT IN (SELECT kpi_code FROM t_mtr_kpi);

UPDATE t_mtr_kpi
SET kpi_description = t_temp_mtr_kpi.kpi_description
FROM t_temp_mtr_kpi
WHERE t_temp_mtr_kpi.kpi_code = t_mtr_kpi.kpi_code;

DELETE FROM t_temp_mtr_kpi 
WHERE kpi_code IN (SELECT kpi_code FROM t_mtr_kpi);

SELECT COUNT(*) FROM t_temp_mtr_kpi INTO icount;

IF icount = 0 THEN
	TRUNCATE TABLE t_temp_mtr_kpi RESTART IDENTITY;
END IF;

RETURN;
END;
$$;


