-- Name: sp_product_mapping(character varying, integer, character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION sp_product_mapping(character varying, integer, character varying) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
DECLARE
icount SMALLINT;

BEGIN
START TRANSACTION;

SELECT COUNT(*) INTO icount FROM t_mtr_item_mapping WHERE item_code = $1 LIMIT 1;

IF icount = 0 THEN

	VALUES ($1, $2, $3, $3);

	UPDATE t_mtr_item
	SET item_group_id = $2
	WHERE item_code = $1;

ELSEIF icount = 1 THEN
	UPDATE t_mtr_item_mapping
	SET item_group_id = $2, updated_by = $3
	WHERE item_code = $1;

END IF;

COMMIT;
END;

$_$;


